import React from "react";
import ContentLoader from "react-content-loader";

const ImageSkeleton = () => (
  <ContentLoader
    rtl
    speed={3}
    width={100}
    height={120}
    viewBox="0 0 90 120"
    backgroundColor="#a9a2a2"
    foregroundColor="#ecebeb"
  >
    <rect x="140" y="294" rx="3" ry="3" width="410" height="6" />
    <rect x="126" y="331" rx="3" ry="3" width="380" height="6" />
    <circle cx="222" cy="340" r="52" />
    <circle cx="51" cy="66" r="40" />
    <circle cx="202" cy="183" r="68" />
  </ContentLoader>
);
export default ImageSkeleton;
